(6, -1, '用户协议', '<div id="protocol-bd">         <h4>服务使用协议</h4>         <p>             欢迎您（即“用户”）来到本网站。本网站所提供的各项服务和内容的所有权和运作全归xxx商城及其关联公司（以下简称“xxx”）。如果用户在本网站上提供的移动应用或软件上（以下简称“xxx商城软件”）访问、预定或使用我们的产品或服务（以上统称为“服务”），便视为用户接受了以下服务协议，请仔细阅读以下内容。如果用户不同意以下任何内容，请立刻停止访问本网站或使用xxx商城服务。</p>         <h5>一、协议总则</h5>         <p><strong>1.1</strong> 本协议内容包括协议正文及xxx其他已经发布的或将来可能发布的各类规则。除另行明确声明外，任何xxx商城软件提供的服务均受本协议约束。 </p>         <p><strong>1.2</strong>             xxx商城如制订、修改本协议及/或各类规则向用户提供基于互联网以及移动网的相关服务的，应在xxx商城软件提前公布通知，用户应该定期登陆本网站及xxx商城软件，了解最新的协议内容。变更后的协议和规则在相关软件及网站上公布后七天，将自动生效。如用户不同意相关变更，应当立即停止访问相关软件或使用软件服务。若用户在相关协议和规则变更七日后继续使用xxx商城服务及网站服务的，即表示用户接受已经修订的协议和规则。         </p>         <p><strong>1.3</strong>             若用户作为xxx商城的关联公司或合作公司的用户登陆相应的xxx商城软件平台，访问或使用相关软件接受服务，即视为用户同意本协议的所有条款及xxx商城公布的其他规则、说明和操作指引。</p>         <h5> 二、服务内容</h5>         <p><strong>2.1</strong>             xxx网络服务的具体内容由xxx商城根据实际经营情况提供。xxx商城保留随时变更、中断或终止部分或全部服务的权利，且不承担因业务调整给用户造成的损失。除非本协议另有其它明示规定，否则增加或强化目前本服务的任何新功能，包括所推出的新产品，均受到本协议之规范。用户了解并同意，本服务仅依其当前所呈现的状况提供，对于任何用户通讯或个人化设定之时效、删除、传递错误、未予储存或其它任何问题，xxx均不承担任何责任。         </p>         <p><strong>2.2</strong> xxx商城在提供本服务时，可能会对部分服务的用户收取一定的费用。在此情况下，xxx商城会在相关页面上做明确的提示。如用户拒绝支付该等费用，则不能使用相关的服务。</p>         <p><strong>2.3</strong>             用户理解，xxx仅提供相关的网络服务，除此之外与相关网络服务有关的设备（如个人电脑、手机、及其他与接入互联网或移动网有关的装置）及所需的费用（如为接入互联网而支付的电话费及上网费、为使用移动网而支付的手机费）均应由用户自行负担。         </p>         <h5>三、服务变更、中断或终止</h5>         <p><strong>3.1</strong> 鉴于网络服务的特殊性，用户同意xxx有权随时变更、中断或终止部分或全部的网络服务。xxx将尽可能在变更、中断或终止之前事先通知用户，但公司对此不承担任何责任。 </p>         <p><strong>3.2</strong>             用户理解，xxx需要定期或不定期地对提供网络服务的平台或相关的设备进行检修或者维护，如因此类情况而造成网络服务在合理时间内的中断，xxx无需为此承担任何责任，但xxx应尽可能事先进行通告。 </p>         <p><strong>3.3</strong> 如发生下列任何一种情形，xxx有权随时中断或终止向用户提供本协议项下的网络服务而无需对用户或任何第三方承担任何责任： </p>         <p><strong>3.3.1</strong><strong> 用户提供的个人资料不真实;</strong></p>         <p><strong>3.3.2</strong><strong> 用户违反本协议中规定的使用规则。</strong></p>         <h5> 四、使用规则</h5>         <p><strong>4.1</strong>             用户在申请使用xxx网络服务时，必须向xxx提供准确的注册信息，用户对注册信息的真实性、合法性、有效性承担全部责任，用户应提供及时、详尽及准确的个人资料，并不断更新注册资料，符合及时、详尽准确的要求。 </p>         <p><strong>4.2</strong>             用户在本网站注册成功后，每个用户将获得一个用户账号及相应的密码，该用户账号和密码由用户负责保管，任何通过用户的账号和密码操作或实施的行为，将视为用户本人的行为，由用户本人承担相应的法律责任和后果。如果用户发现他人不当使用用户的账户或有任何其他可能危及用户的账户安全的情形时，应当立即以书面、有效方式通知xxx商城，要求xxx商城暂停相应账号的相关服务。在此，用户理解xxx商城对用户的请求采取行动需要合理时间，公司对在采取行动前已经产生的后果（包括但不限于用户的任何损失）不承担任何责任。         </p>         <p><strong>4.3</strong>             用户同意xxx有权在提供网络服务过程中以各种方式投放各种商业性广告或其他任何类型的商业信息（包括但不限于在xxx网站的任何页面上投放广告），并且，用户同意接受xxx通过电子邮件或其他方式向用户发送商品促销或其他相关商业信息。         </p>         <p><strong>4.4</strong>             对于用户通过xxx网络服务（包括但不限于论坛、BBS、评论）上传到xxx网站上可公开获取区域的任何内容，用户同意xxx在全世界范围内具有免费的、永久性的、不可撤销的、非独家的和完全再许可的权利和许可，以使用、复制、修改、改编、出版、翻译、据以创作衍生作品、传播、表演和展示此等内容（整体或部分），和/或将此等内容编入当前已知的或以后开发的其他任何形式的作品、媒体或技术中。         </p>         <p><strong>4.5</strong> 用户在使用xxx网络服务过程中，必须遵循以下原则：</p>         <p><strong>4.5.1</strong> 遵守中华人民共和国有关的法律和法规；</p>         <p><strong>4.5.2</strong> 遵守所有与网络服务有关的网络协议、规定和程序；</p>         <p><strong>4.5.3</strong> 不得为任何非法目的而使用网络服务系统；</p>         <p><strong>4.5.4</strong> 不得以任何形式使用xxx网络服务侵犯xxx的商业利益，包括但不限于发布非经xxx许可的商业广告；</p>         <p><strong>4.5.5</strong> 不得利用xxx网络服务系统进行任何可能对互联网或移动网正常运转造成不利影响的行为；</p>         <p><strong>4.5.6</strong> 不得利用xxx提供的网络服务上传、展示或传播任何虚假的、骚扰性的、中伤他人的、辱骂性的、恐吓性的、庸俗淫秽的或其他任何非法的信息资料；</p>         <p><strong>4.5.7</strong> 不得侵犯其他任何第三方的专利权、著作权、商标权、名誉权或其他任何合法权益；</p>         <p><strong>4.5.8</strong> 不得利用xxx网络服务系统进行任何不利于xxx的行为。</p>         <p><strong>4.6</strong>             xxx有权对用户使用xxx网络服务的情况进行审查和监督，如用户在使用网络服务时违反任何上述规定，xxx或其授权的人有权要求用户改正或直接采取一切必要的措施（包括但不限于更改或删除用户张贴的内容等、暂停或终止用户使用网络服务的权利）以减轻用户不当行为造成的影响。         </p>         <p><strong>4.7</strong>             xxx针对某些特定的xxx网络服务的使用通过各种方式（包括但不限于网页公告、电子邮件、短信提醒等）作出的任何声明、通知、警示等内容视为本协议的一部分，用户如使用该等xxx网络服务，视为用户同意该等声明、通知、警示的内容。         </p>         <p><strong>4.8</strong>             用户须对自己在使用xxx商城服务过程中的行为承担法律责任，包括但不限于：对受到侵害者进行赔偿，以及在xxx在先承担了因用户的行为导致的行政处罚或侵权损害赔偿责任后，用户应给予xxx商城等额的赔偿。</p>         <h5> 五、知识产权</h5>         <p><strong>5.1</strong>             xxx提供的网络服务中包含的任何文本、图片、图形、音频和/或视频资料均受版权、商标和/或其它财产所有权法律的保护，未经xxx同意，上述资料均不得在任何媒体直接或间接发布、播放、出于播放或发布目的而改写或再发行，或者被用于其他任何商业目的。所有这些资料或资料的任何部分仅可作为私人和非商业用途而保存在某台计算机内。xxx不就由上述资料产生或在传送或递交全部或部分上述资料过程中产生的延误、不准确、错误和遗漏或从中产生或由此产生的任何损害赔偿，以任何形式，向用户或任何第三方负责。         </p>         <p><strong>5.2</strong>             xxx为提供网络服务而使用的任何软件（包括但不限于软件中所含的任何图象、照片、动画、录像、录音、音乐、文字和附加程序、随附的帮助材料）的一切权利均属于该软件的著作权人，未经该软件的著作权人许可，用户不得对该软件进行反向工程（reverse             engineer）、反向编译（decompile）或反汇编（disassemble）。</p>         <p><strong>5.3</strong>             用户如在xxx商城平台上有张贴和共享自己信息的情形，应保证所张贴和共享的内容位于公共领域内，或者用户保证拥有这些内容完整的、无瑕疵的所有权和知识产权或拥有完整的授权，并不存在任何侵犯第三方合法权益的情形，包括但不限于著作权、肖像权、商标权、专利权、企业名称权、商号权、商业秘密、个人隐私、合同权利等权利。xxx商城如收到正式版权投诉，将会删除这些内容。所有因用户非法上传内容而给任何第三方或xxx商城造成的损害均由用户个人承担全部的责任，xxx商城不承担任何责任，且xxx商城有义务配合第三方、司法机关或行政机关完成相关的取证，并根据法律、主管部门或司法部门的要求将用户注册信息给予披露。         </p>         <p><strong>5.4</strong> 用户发表在xxx商城的原创文章、评论、图片等内容的版权均归用户本人所有。用户同意xxx商城及其关联公司有权（全部或部份地)             使用、复制、修订、改写、发布、翻译、分发、执行和展示用户的全部资料数据（包括但不限于交易行为数据及全部展示于xxx商城平台的各类信息）或制作其派生作品，并以现在已知或日后开发的任何形式、媒体或技术，将上述信息纳入xxx商城作品内。         </p>         <p><strong>5.5</strong>             用户浏览、复制、打印和传播xxx商城其他用户上传到xxx商城的内容，应保证仅用于个人欣赏之目的，不得用于商业目的，不得侵犯权利人的合法权益以及xxx商城的合法权益和商业利益。任何用户违反此条规定的，xxx商城均有权以自身名义利用法律手段寻求权利救济或据本协议追究用户的违约责任。         </p>         <h5> 六、隐私保护</h5>         <p><strong>6.1</strong> 保护用户隐私是xxx的一项基本政策，xxx商城保证不对外公开或向第三方提供单个用户的注册资料及用户在使用网络服务时存储在xxx商城的非公开内容，但下列情况除外： </p>         <p><strong>6.1.1</strong><strong> 事先获得用户的明确授权；</strong></p>         <p><strong>6.1.2</strong><strong> 只有透露用户的个人资料，才能提供用户所要求的产品和服务</strong></p>         <p><strong>6.1.3</strong><strong> 根据有关的法律法规要求；</strong></p>         <p><strong>6.1.4</strong><strong> 按照相关政府主管部门的要求；</strong></p>         <p><strong>6.1.5</strong><strong> 为维护社会公众的利益；</strong></p>         <p><strong>6.1.6</strong><strong> 为维护xxx商城的合法权益。</strong></p>         <p><strong>6.1.7</strong><strong> 用户同意让第三方共享资料；</strong></p>         <p><strong>6.1.8</strong><strong> 根据本协议的其他规定。</strong></p>         <p>