(135, 16, '溯源法国婕珞芙“谜样传奇”', '<p style="text-indent:2em;">\r\n	也许你还未听说过这个名字——GELLE \r\nFRERES（婕珞芙），也许你还不了解这个品牌的传奇事迹。一个诞生于1826年法国巴黎的品牌，因其配方奠基人「让•路易•法赫基翁 \r\nJean-Louis Fargeon」而流传下来的神秘配方，让她从建立之初就快速的俘获众多拥趸。\r\n</p>\r\n<p style="text-indent:2em;">\r\n	时光穿梭，经典不朽，近200年的时空淬炼赋予了婕珞芙GELLE FRERES更加优雅和迷人的气质。纵使今天，低调款款前行，依然攫取众人的惊艳目光。\r\n</p>\r\n<p style="text-indent:2em;">\r\n	经典缔造\r\n</p>\r\n<p style="text-indent:2em;">\r\n	说到法国婕珞芙GELLE FRERES的品牌传奇不得不从1773年开始，一位出生于蒙彼利埃的天才调香师「让•路易•法赫基翁 Jean-Louis Fargeon」从法国格拉斯皇家香水学院毕业后，便来到巴黎在法国香水界初露锋芒。\r\n</p>', '', '', '', 0, 1, 1487353252, '', 0, 'http://', '', 'data/article/1491358111728544003.jpg'),
(136, 16, '法国婕珞芙明星产品 打造女王级美肌', '源自1826年的法国皇室御用植萃香氛护肤品牌婕珞芙，曾经服务于玛丽皇后、拿破仑、欧仁尼皇后等皇室名流，是历史上被同时称为「调香世家」和「芳疗世家」的品牌。秉承着“令你成谜”的品牌理念，凝聚了几代人的智慧结晶，始终扮演着“美的管家”这一角色。婕珞芙到底有着怎样的“魔力”，揽获了各个时代女性的芳心垂爱，令人如此着迷，让我们一起走进天然植萃的世界，探秘百年婕珞芙的三款明星产品，会给今日女王带来哪些与众不同的护肤体验。', '', '', '', 0, 1, 1487353284, '', 0, 'http://', '', 'data/article/1491357993483349294.jpg'),
(137, 16, '亚洲人气女星唐嫣出任法国婕珞芙中国区品牌代言人', '<p>\r\n	活动当天，法国GELLÉ \r\nFRÈRES(婕珞芙)品牌代言人亚洲人气女星唐嫣小姐身着华丽高雅的连衣裙，举手投足间散发着高贵知性的迷人气质，将新时代女性的自信优雅完美演绎。唐嫣畅谈了对于担任法国GELLÉ\r\n FRÈRES(婕珞芙)品牌代言人的感想：“法国GELLÉ \r\nFRÈRES(婕珞芙)是一个有着悠久历史的经典品牌，在欧洲享有盛誉，我非常认可她所倡导的‘天然纯净’‘高效呵护’‘芬芳愉悦’的护肤理念。能够成为这一传奇品牌的推广者我感到很荣幸，也很开心”。\r\n</p>\r\n<p>\r\n	“每个女人都渴望拥有令人羡慕的肌肤，法国GELLÉ \r\nFRÈRES(婕珞芙)「Elixir魔药」就有着与众不同的优雅魔力，在这里我要特别给大家推荐品牌为我定制的SWEET \r\nBOX专属礼盒。该款礼盒包括明星产品——灵感花园多效精华油，以及一本谜样女王的美丽养成日记。现已在法国GELLÉ \r\nFRÈRES(婕珞芙)官方网站上同步发售。希望更多的爱美女性能够通过法国GELLÉ \r\nFRÈRES(婕珞芙)天然植萃的护肤产品，活出全新闪耀的自己”。\r\n</p>', '', '', '', 0, 1, 1487353314, '', 0, 'http://', '', 'data/article/1491357803993410045.jpg'),
(138, 16, '精油+面膜，保湿新玩法！', '<span class="jsClickRegion">说到面膜，绝对是很多护肤达人的挚爱，也有很多姑娘坚信敷面膜是拥有完美肌肤的基础。而在各种功能性面膜中，我们最常购买及使用的就是保湿面膜。</span>', '', '', '', 0, 1, 1487353383, '', 0, 'http://', '', 'data/article/1491357691006189330.jpg'),
(139, 16, '法国GELLé FRèRES婕珞芙「Elixir魔药0号」书写中国护肤传奇 ', '<p>\r\n	作为法国经典化妆品品牌，法国GELLÉ FRÈRES婕珞芙深谙法国植物医药学精髓，沿袭法国宫廷护肤配方的精湛调配技艺，曾服务于玛丽皇后、欧仁妮皇后、杜莎夫人等各界名流，风靡欧洲近两百年之久，并时刻影响着国际美容时尚潮流的发展。早在去年9月，法国GELLÉ FRÈRES婕珞芙在巴黎时装周期间举办了惊艳全球的“令你成谜”品牌发布会，吸引了全球美容时尚界的广泛关注。今天，法国GELLÉ FRÈRES婕珞芙品牌携最强新品「Elixir魔药」系列震撼来华，标志了法国GELLÉ FRÈRES婕珞芙品牌全面进驻中国市场的开启。\r\n</p>\r\n<p>\r\n	<strong>「Elixir 魔药」系列产品】</strong> \r\n</p>\r\n<p>\r\n	<strong>传承·焕新·重生</strong> \r\n</p>\r\n<p>\r\n	法国GELLÉ \r\nFRÈRES婕珞芙源自法国植物医药学的精髓「Elixir魔药」，是由玛丽皇后亲赐其名。「Elixir魔药」一词意为炼金术，即将植物中的营养成分以最佳的工艺提炼运用到极致。近两百年来，法国GELLÉ\r\n FRÈRES婕珞芙品牌一直没有停止创新的脚步，每代品牌继承人都是独具匠心之人，于全球甄选最优花材，从最佳部位提取精华，将植物的能量转换为护肤原动力。今天，法国GELLÉ FRÈRES婕珞芙针对当代女性的肌肤需求，对古老的「Elixir 魔药」配方升级完善，研发出适合时代需求的新品——「Elixir 魔药0-4号」配方，产品涵盖多效修护、舒缓、保湿、抗老、美白等功效，解决女性多种肌肤问题，带来更高效、更安全的愉悦体验。纵使时光流转，不老的魔力总是让人无法抗拒。\r\n</p>', '', '', '', 0, 1, 1491842681, '', 0, 'http://', '', 'data/article/1491842681577448444.jpg'),
(140, 16, '婕珞芙携手陈妍希、张慧雯点亮巴黎之夜', '<p>\r\n	汇聚全球一线品牌、大牌设计师以及众多明星名流的巴黎时装周，一直是国际四大时装周的压轴好戏，每一年最有艺术性、最奢华的大秀都在这里上演，巴黎历经几个世纪，都一直牢牢把持着时尚界霸主的地位！从传奇的Chanel到高冷的Dior，从满血复活的Balenciaga到优雅传承的Valentino...时尚圈的最根本力量全部在这里汇集。而作为2015巴黎时装周的一大盛事，拥有近两百年历史的调香世家及芳疗世家的精油护肤品牌，法国GELLÉ\r\nFRÈRES婕珞芙巴黎发布会更是吸引了巴黎美容时尚界的热切关注。中国人气女星陈妍希及新生代“谋女郎”张慧雯等众多中法两国化妆品界、时尚界、新闻界人士齐聚Casino\r\n de Paris，共同助阵并见证了法国GELLÉ FRÈRES婕珞芙“谜样重生”的重要时刻。\r\n</p>\r\n<p style="text-align:left;">\r\n	活动当晚（法国时间9月27日），作为不仅斩获多项演艺界大奖，更是捕获万千少男爱慕之心的当红人气女星陈妍希，身着Georges Hobeika粉色立体花朵刺绣连身裙，搭配Christian Louboutin白色尖头鞋，将清新优雅完美演绎。活动现场，陈妍希也对心目中「谜一样的女人是什么样」做了诠释：“我心目中谜一样的女人，小龙女算是一个，她可以那么长时间不老，保持美貌，真的非常神奇。今天，也很荣幸受法国GELLÉ\r\nFRÈRES婕珞芙品牌邀请来到法国，我觉得法国国宝级女星苏菲·玛索对我来说也算是一位谜一样的女人，一直以来，她都是那么优雅，充满魅力，非常地令我着迷”。\r\n</p>', '', '', '', 0, 1, 1491842772, '', 0, 'http://', '', 'data/article/1491842772417564921.jpg'),
(141, 16, '中国明星陈妍希、张慧雯助阵，百年历史的美妆品牌', '2015年9月27日，法国巴黎，海报编编受邀前往巴黎参加美妆品牌GELLÉ FRÈRE婕珞芙新品全球发布会。在这场主题为“谜样重生”的发布会上，我们见证了GELLÉ FRÈRE婕珞芙品牌200年历史，皇家御用调香师，同时发布了5个古老的神秘配方，并称之为“ELIXIR魔药”。“魔药”系列的面世见证着品牌从专注于个人美容沙龙护肤将回归大众精油护肤领域，并即将携“魔药”进军全球市场。', '', '', '', 0, 1, 1491842847, '', 0, 'http://', '', 'data/article/1491842847840276283.jpg'),
(142, 16, '法国GELLÉ FRÈRES婕珞芙“谜样重生”巴黎发布会', '百年法国GELLÉ FRÈRES婕珞芙“谜样重生”名流云集\r\n<p>\r\n	　　法国GELLÉ \r\nFRÈRE婕珞芙（简称GF，音译“婕珞芙”）品牌创建于1826年，凭借独特的植物萃取、蒸馏调配和芳疗能力，成为历史上第一个被同时称为调香世家和芳疗世家的品牌，在世界美容护肤、时尚届有着举足轻重的地位。此次2015“谜样重生”品牌发布会，既是一次法国GELLÉ\r\n FRÈRES婕珞芙品牌溯源之旅，也标志着法国GELLÉ FRÈRES婕珞芙未来市场新战略的开启，将影响世界美容护肤市场的新格局。\r\n</p>\r\n<p>\r\n	　　发布会邀请了著名调香师Isabelle Gellé（Gellé家族传人），时任法国GELLÉ \r\nFRÈRE婕珞芙品牌主席、兼任香水协会主席Lecaron先生的曾孙女Pauline \r\nDemedeiros女士，法国乐尔福集团总裁Sabata先生，法国Centedegree设计集团CEO \r\nEliePapiernik先生，法国GELLÉ\r\n</p>\r\n<p>\r\n	　　FRÈRES婕珞芙集团总裁Simon Menard先生以及法国GELLÉ \r\nFRÈRE婕珞芙集团中国区总裁何健先生联袂出席盛会。同时，中国人气女星陈妍希，新生代“谋女郎”张慧雯等众多中法两国化妆品界、时尚界、新闻界人士亦前往法国巴黎助阵，一同见证法国GELLÉ\r\n FRÈRES婕珞芙的重要时刻。\r\n</p>', '', '', '', 0, 1, 1491842903, '', 0, 'http://', '', 'data/article/1491842903754131447.jpg'),
(143, 16, 'Gellé Frères（婕珞芙）特邀参展2015巴黎国际美容博览会', 'Beyond Beauty \r\nParis（巴黎国际美容博览会）是领导全球美容市场潮流发展的先驱，美容、彩妆及天然草本产品的世界级品牌均汇聚于此。Beyond Beauty \r\nParis成立于2002年，历经13年时间的发展，目前已经成为欧洲秋季最大、最具成交效果的专业级国际美容博览会。', '', '', '', 0, 1, 1491842962, '', 0, 'http://', '', 'data/article/1491842962102738778.jpg'),
(146, 16, '杏福梅林', '<p align="center">\r\n	【杏福硒峪】这里有一套高端时尚的绿色健康秘笈<br />\r\n最近，豆瓣高评分神剧《我不是药神》，火的一塌糊涂，上映至今13天，票房已达25.59亿。 <br />\r\n&nbsp;许多人看过电影后，都能感觉到人在面对病魔时的无奈，这也反应出了当下人们越来越重视的一个问题：健康！<br />\r\n习近平总书记指出：“我们既要绿水青山，也要金山银山。宁要绿水青山，不要金山银山，而且绿水青山就是金山银山。”<br />\r\n&nbsp;绿色与健康，才是当今人们生活所追求的高端时尚。<br />\r\n&nbsp;但如今，及其不规律的作息时间、暴饮暴食、长期接受手机等电子产品的辐射……使得无数人的健康受到了严重影响，甚至于患上“癌”等不治之症！<br />\r\n&nbsp;那么，你想要健康吗？<br />\r\n&nbsp;河北杏福硒（xi）峪（yu）生态农业开发有限公司，将为您送上一份高端时尚的健康秘笈！<br />\r\n&nbsp;位于太行山东麓的河北涉县，人杰地灵、风景秀丽。在这个美丽的地方，孕育着一种自然之瑰宝，健康之灵药——杏。<br />\r\n&nbsp;杏在中草药中具有重要地位，主治风寒肺病，生津止渴，润肺化痰，清热解毒等功效。<br />\r\n&nbsp;而在近现代科学的研究中，杏更是被发现含有丰富的微量元素——硒。<br />\r\n&nbsp;杏福硒峪通过多次考察，接受健康专家的指导意见，在当地政府的大力支持下，决心构建一个由“杏”堆砌的“硒”峪。让“硒”之光照亮亿万人的健康之路。<br />\r\n&nbsp;目前，杏福硒峪投入了大量资金与科研力量，在当地政府的监督指导下，积极进行“杏”“硒”类产品开发<br />\r\n&nbsp;并将立足于当地杏树种植基地，大力开发生态旅游，让客户、游客赏杏花、吃杏果、品杏酒、嗑杏仁、种杏树。让所有追求健康的人，感受到杏所带来的幸福。\r\n</p>', 'jeaky', 'jeaky', 'jeaky', 0, 1, 1531874784, 'data/article/1531879771566089435.jpg', 2, 'http://', '', 'data/article/1531874953610745690.jpg');
